webpackJsonp([57,423],{2:function(e,t){e.exports="data:image/png;base64,"},21:function(e,t){e.exports="data:image/png;base64,"},66:function(e,t){e.exports="data:image/png;base64,"},254:function(e,t,l){e.exports=l.p+"_/oppgaver/src/scratch/orkenlop/orkenlop.241bda.png"},1621:function(e,t,l){e.exports={frontmatter:l(638),content:l(2796)}},2796:function(e,t,l){e.exports="<section class=intro id=introduksjon> <h1 class=intro id=introduksjon>Introduksjon</h1> <p>Dette er et spill for to, der en papegøye og en løvinne kjemper om å komme først gjennom ørkenen. Hver spiller må trykke en tast så fort og ofte som mulig for å flytte figuren sin, og den som kommer først til kanten av skjermen vinner.</p> <figure><img src="+l(254)+' alt=""></figure> </section> <section class=activity id=steg-1-lag-en-scene-og-legg-til-figurer> <h1 class=activity id=steg-1-lag-en-scene-og-legg-til-figurer>Steg 1: Lag en scene og legg til figurer</h1> <p><em>Vi begynner med å få på plass bakgrunnen og figurene.</em></p> <section class=check id=sjekkliste> <h2 class=check id=sjekkliste>Sjekkliste</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_0><label for=cbx_0> Klikk på Scene og velg en ferdig bakgrunn, <img src='+l(66)+' alt="velg en ferdig bakgrunn">. Velg <code>Natur/desert</code>.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_1><label for=cbx_1> Fjern katten ved å høyreklikke på figuren og velg <code>slett</code>.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_2><label for=cbx_2> Legg til en ny figur ved å trykke på <img src='+l(2)+' alt="velg figur fra biblioteket">. Velg <code>Dyr/Lionness</code>.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_3><label for=cbx_3> Legg så til enda en ny figur: velg <code>Dyr/Parrot</code>. Krymp figuren slik at den er omtrent like stor som løvinnen ved å bruke <img src='+l(21)+" alt=krymp>.</label></p> </li> </ul> </section> </section> <section class=activity id=steg-2-la-lovinnen-og-papegoyen-bevege-seg> <h1 class=activity id=steg-2-la-lovinnen-og-papegoyen-bevege-seg>Steg 2: La løvinnen og papegøyen bevege seg</h1> <p><em>Vi vil at figurene skal bevege seg når du trykker på en knapp.</em></p> <section class=check id=sjekkliste-2> <h2 class=check id=sjekkliste-2>Sjekkliste</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_4><label for=cbx_4> Velg først løvefiguren og få den til å <code class=blockmotion>gå 4 steg</code> når du trykker <code>L</code> tasten.</label></p> <pre class=blocks>når [l v] trykkes\ngå (4) steg\n</pre> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_5><label for=cbx_5> Velg så papegøyefiguren og la den <code class=blockmotion>gå 4 steg</code> når du trykker <code>A</code> tasten.</label></p> <pre class=blocks>når [a v] trykkes\ngå (4) steg\n</pre> </li> </ul> </section> <section class=flag id=test-prosjektet> <h2 class=flag id=test-prosjektet>Test prosjektet</h2> <p><strong>Klikk på det grønne flagget.</strong></p> <ul class=task-list> <li class=task-list-item><input type=checkbox id=cbx_6><label for=cbx_6> Beveger løvinnen og papegøyen seg over skjermen når du trykker på <code>A</code> og <code>L</code> tastene?</label></li> </ul> </section> </section> <section class=activity id=steg-3-start-kapplopet> <h1 class=activity id=steg-3-start-kapplopet>Steg 3: Start kappløpet</h1> <p><em>Nå må vi kjøre i gang kappløpet og kåre en vinner. Vi begynner med å lage startknapp.</em></p> <section class=check id=sjekkliste-3> <h2 class=check id=sjekkliste-3>Sjekkliste</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_7><label for=cbx_7> Legg til en ny figur. Velg <code>Ting/Button3</code>. Flytt den til midten av scenen.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_8><label for=cbx_8> Klikk på <code>Drakter</code>-fanen og verktøyet <code>T</code> for å legge til tekst. Trykk på venstre kant av knappen for å legge til et tekstfelt og skriv inn teksten <code>Start</code>. Du kan flytte på teksten ved å trykke en gang på den, og endre innhold ved å dobbeltklikke.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_9><label for=cbx_9> Legg nå til et skript som viser figuren når spillet starter:</label></p> <pre class=blocks>når grønt flagg klikkes\nvis\n</pre> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_10><label for=cbx_10> I tillegg vil vi at knappen først teller ned fra 3, sier <code>LØP!</code> og deretter blir skjult når den klikkes. Dette ordner du med følgende skript:</label></p> <pre class=blocks>når denne figuren klikkes\nsi [3] i (1) sekunder\nsi [2] i (1) sekunder\nsi [1] i (1) sekunder\nsi [LØP!] i (1) sekunder\nskjul\n</pre> </li> </ul> </section> <section class=flag id=test-prosjektet-2> <h2 class=flag id=test-prosjektet-2>Test prosjektet</h2> <p><strong>Klikk på det grønne flagget, og deretter på startknappen.</strong></p> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_11><label for=cbx_11> Teller knappen ned?</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_12><label for=cbx_12> Sier den <code>LØP!</code>?</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_13><label for=cbx_13> Blir den borte?</label></p> </li> </ul> <p>Vi ønsker at figurene bare beveger seg etter at kappløpet er startet og vi ønsker å vite når kappløpet er over.</p> </section> <section class=check id=sjekkliste-4> <h2 class=check id=sjekkliste-4>Sjekkliste</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_14><label for=cbx_14> For å vite når kappløpet har startet og sluttet lager vi en variabel med navnet <code class=blockdata>kappløp</code>. Variabelen skal være tilgjengelig <code>for alle figurer</code>. Fjern avhukingen foran variabelen, slik at den ikke vises på scenen.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_15><label for=cbx_15> Sett <code class=blockdata>kappløp</code> til 0 når spillet startes ved å forandre <code class=blockevents>når grønt flagg klikkes</code>-skriptet slik:</label></p> <pre class=blocks>når grønt flagg klikkes\nvis\nsett [kappløp v] til [0]\n</pre> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_16><label for=cbx_16> Når nedtellingen er ferdig og løpet begynner, forandrer vi <code class=blockdata>kappløp</code>-verdien til 1. Dette gjør du ved å legge til klossen <code class=blockdata>Sett kappløp til 1</code> under <code class=blocklooks>si 1 i 1 sekunder</code> i skriptet som starter med <code class=blockevents>når denne figuren klikkes</code>.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_17><label for=cbx_17> Nå må vi lage en regel som sier at figurene bare får lov til å bevege seg etter at løpet har startet – det vil si når <code class=blockdata>kappløp</code> har verdien 1. Klikk først på papegøyen. Så endrer du:</label></p> <pre class=blocks>når [a v] trykkes\nhvis &lt;(kappløp) = [1]&gt;\n    gå (4) steg\nslutt\n</pre> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_18><label for=cbx_18> Gjenta det samme for løvinnen.</label></p> </li> </ul> </section> <section class=flag id=test-prosjektet-3> <h2 class=flag id=test-prosjektet-3>Test prosjektet</h2> <p><strong>Klikk på det grønne flagget.</strong></p> <ul class=task-list> <li class=task-list-item><input type=checkbox id=cbx_19><label for=cbx_19> Kan løvinnen og papegøyen bare flytte seg når nedtellingen er ferdig?</label></li> </ul> </section> </section> <section class=activity id=steg-4-avslutte-kapplopet> <h1 class=activity id=steg-4-avslutte-kapplopet>Steg 4: Avslutte kappløpet</h1> <p><em>Nå vil vi finne ut hvem som vinner kappløpet, og i tillegg gjøre klart for en ny runde.</em></p> <section class=check id=sjekkliste-5> <h2 class=check id=sjekkliste-5>Sjekkliste</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_20><label for=cbx_20> Legg til en kloss i papegøyens skript som sier <code class=blockdata>sett kappløp til 0</code> hvis figuren berører kanten av skjermen:</label></p> <pre class=blocks>når [a v] trykkes\nhvis &lt;(kappløp) = [1]&gt;\n    gå (4) steg\n    hvis &lt;berører [kant v]?&gt;\n        sett [kappløp v] til [0]\n    slutt\nslutt\n</pre> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_21><label for=cbx_21> Spill så inn en lyd som skal spilles av hvis papegøyen vinner.</label></p> <p>Trykk på <code>Lyder</code>-fanen og deretter mikrofon-ikonet og spill inn en morsom trudelutt! Opptaket starter når du har klikket på rundingen slik at den blir rød. Klikk stopp (firkanten) når du er ferdig, og gi lyden et navn – for eksempel <code>Polly</code>. Noen nettlesere kan spørre om tillatelse til å spille inn lyd. Hvis du ikke ønsker dette, bruk lydene som følger med figurene.</p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_22><label for=cbx_22> Deretter legger du til klossene som spiller lyden og lar papegøyen fortelle at den vant:</label></p> <pre class=blocks>når [a v] trykkes\nhvis &lt;(kappløp) = [1]&gt;\n    gå (4) steg\n    hvis &lt;berører [kant v]?&gt;\n        sett [kappløp v] til [0]\n        spill lyden [Polly v]\n        si [Polly vinner!] i (3) sekunder\n    slutt\nslutt\n</pre> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_23><label for=cbx_23> Gjør tilsvarende for løvinnen.</label></p> </li> </ul> </section> <section class=flag id=test-prosjektet-4> <h2 class=flag id=test-prosjektet-4>Test prosjektet</h2> <p><strong>Klikk på det grønne flagget.</strong></p> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_24><label for=cbx_24> Kan du trykke på startknappen og deretter bevege dyrene med tastene <code>A</code> og <code>L</code>?</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_25><label for=cbx_25> Kommer riktig vinnerlyd og melding opp på skjermen?</label></p> </li> </ul> </section> </section> <section class=activity id=steg-5-nullstill-spillet> <h1 class=activity id=steg-5-nullstill-spillet>Steg 5: Nullstill spillet</h1> <p><em>Når kappløpet er over må vi fortelle de andre figurene at spillet er over og nullstille spillet, slik at er klart for en ny runde.</em></p> <section class=check id=sjekkliste-6> <h2 class=check id=sjekkliste-6>Sjekkliste</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_26><label for=cbx_26> Klikk på papegøyefiguren og legg til en kloss som sender melding <code>Avslutt</code> etter at figuren sier den har vunnet.</label></p> <pre class=blocks>når [a v] trykkes\nhvis &lt;(kappløp) = [1]&gt;\n    gå (4) steg\n    hvis &lt;berører [kant v]?&gt;\n        sett [kappløp v] til [0]\n        spill lyden [Polly v]\n        si [Polly vinner! v] i (3) sekunder\n        send melding [Avslutt v]\n    slutt\nslutt\n</pre> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_27><label for=cbx_27> Vi trenger nå et nytt skript som lytter etter denne avslutningsmeldingen og flytter papegøyen tilbake til start.</label></p> <pre class=blocks>når jeg mottar [Avslutt v]\nsett x til (-170)\n</pre> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_28><label for=cbx_28> Gjør det samme for løvinnen. Test forskjellige <code>x</code>-verdier for å være sikker på at løvinnen og papegøyen starter fra samme sted.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_29><label for=cbx_29> For at figurene skal stå på startstreken når kappløpet starter den aller første gangen må vi også legge til følgende klosser på begge figurene:</label></p> <pre class=blocks>når grønt flagg klikkes\nsett x til (-170)\n</pre> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_30><label for=cbx_30> For at spillerne skal kunne klikke i gang nye runder må vi passe på at start-knappen kommer tilbake etter hver avsluttet runde. Klikk på startknapp-figuren og legg til et skript som viser knappen når avslutningsmeldingen blir mottatt.</label></p> <pre class=blocks>når jeg mottar [Avslutt v]\nvis\n</pre> </li> </ul> </section> <section class=flag id=test-prosjektet-5> <h2 class=flag id=test-prosjektet-5>Test prosjektet</h2> <p><strong>Klikk på det grønne flagget.</strong></p> <ul class=task-list> <li class=task-list-item><input type=checkbox id=cbx_31><label for=cbx_31> Kan du spille mot en venn? En av dere styrer papegøyen ved å trykke <code>A</code>, og den andre løvinnen ved å trykke <code>L</code>.</label></li> </ul> </section> <section class=save id=lagre-prosjektet> <h2 class=save id=lagre-prosjektet>Lagre prosjektet</h2> <p>Spillet er ferdig! Hvis du vil kan du velge <code>Legg ut</code> slik at venner og familie også kan spille det.</p> <p>Nedenfor er det noen forslag og ideer til hvordan du kan utvide spillet og gjøre det enda mer interessant.</p> </section> <section class=challenge id=utfordring-1-legg-til-en-rakett> <h2 class=challenge id=utfordring-1-legg-til-en-rakett>Utfordring 1: Legg til en rakett!</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_32><label for=cbx_32> <strong>Legg til en rakett</strong> som kan brukes én gang per kappløp og som flytter papegøyen eller løvinnen <strong>30 steg på en gang.</strong></label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_33><label for=cbx_33> <strong>Legg til en ny drakt</strong> med ild som kommer ut bak figurene. La denne aktiveres når raketten avfyres.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_34><label for=cbx_34> <strong>Lag en lyd</strong> som figuren kan gi fra seg når raketten avfyres.</label></p> </li> </ul> <p>Nedenfor er et forslag til hvordan et rakett-skript kan se ut. Du må legge til noen lyder og variabler på egen hånd.</p> <pre class=blocks>når [q v] trykkes\nhvis &lt;&lt;(kappløp) = [1]&gt; og &lt;(rakett_brukt) = [0]&gt;&gt;\n    bytt drakt til [parrot-rakett v]\n    sett [rakett_brukt v] til [1]\n    gå (30) steg\n    spill lyden [motorcycle passing v]\n    hvis &lt;berører [kant v]?&gt;\n        sett [kappløp v] til [0]\n        spill lyden [Polly v]\n        si [Polly vinner! v] i (3) sekunder\n        send melding [Avslutt v]\n    slutt\n    bytt drakt til [parrot-a v]\nslutt\n</pre> </section> <section class=flag id=test-prosjektet-6> <h2 class=flag id=test-prosjektet-6>Test prosjektet</h2> <p><strong>Klikk på det grønne flagget.</strong></p> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_35><label for=cbx_35> Fungerer raketten slik du hadde planlagt?</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_36><label for=cbx_36> Hva skjer om man forsøker å bruke raketten to ganger?</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_37><label for=cbx_37> Hva skjer om man bruker raketten for å komme til mål?</label></p> </li> </ul> </section> <section class=challenge id=utfordring-2-bruk-egendefinerte-klosser-for-a-forenkle-skriptet-ditt> <h2 class=challenge id=utfordring-2-bruk-egendefinerte-klosser-for-a-forenkle-skriptet-ditt>Utfordring 2: Bruk egendefinerte klosser for å forenkle skriptet ditt</h2> <p>Koden som brukes til å sjekke om kappløpet er over brukes nå to steder for hver figur; når figuren beveger seg normalt og når den beveger seg med rakett. Vi kan forenkle skriptet vårt ved å bruke en egendefinert kloss. Dette er en samling kode som brukes flere steder. Det er nesten som at vi lager vår egen Scratch-kodekloss!</p> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_38><label for=cbx_38> Velg papegøyens skript.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_39><label for=cbx_39> Velg <code class=blockmoreblocks>Flere klosser</code>-paletten og klikk så på <code>Lag en kloss</code>-knappen.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_40><label for=cbx_40> Kall klossen din <code>ferdig</code> og trykk OK.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_41><label for=cbx_41> Du vil nå få en <code class=blockmoreblocks>definer ferdig</code>-kloss i skriptvinduet ditt. Flytt den litt for seg selv.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_42><label for=cbx_42> Løsriv hele <code class=blockcontrol>hvis</code><code class=blocksensing>berører kant?</code>-klossen og dra den til <code class=blockmoreblocks>definer ferdig</code>-klossen.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_43><label for=cbx_43> Kan du dra <code class=blockmoreblocks>ferdig</code>-klossen fra paletten og bruke den på samme måte som andre kodeklosser?</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_44><label for=cbx_44> Slett den andre <code class=blockcontrol>hvis</code><code class=blocksensing>berører kant?</code>-klossen fra skriptet ditt og erstatt også den med en <code class=blockmoreblocks>ferdig</code>-kloss.</label></p> <pre class=blocks>definer ferdig\nhvis &lt;berører [kant v]?&gt;\n    sett [kappløp v] til [0]\n    spill lyden [Polly v]\n    si [Polly vinner! v] i (3) sekunder\n    send melding [Avslutt v]\n\nnår [a v] trykkes\nhvis &lt;(kappløp) = [1]&gt;\n    gå (4) steg\n    ferdig\n\nnår [q v] trykkes\nhvis &lt;&lt;(kappløp) = [1]&gt; og &lt;(rakett_brukt) = [0]&gt;&gt;\n    bytt drakt til [parrot-rakett v]\n    sett [rakett_brukt v] til [1]\n    gå (30) steg\n    spill lyden [motorcycle passing v]\n    ferdig\n    bytt drakt til [parrot-a v]\n</pre> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_45><label for=cbx_45> Gjør dette koden din enklere å lese? Kan du lage en tilsvarende egendefinert kloss for løvinnen?</label></p> </li> </ul> </section> <section class=flag id=test-prosjektet-7> <h2 class=flag id=test-prosjektet-7>Test prosjektet</h2> <p><strong>Klikk på det grønne flagget.</strong></p> <ul> <li> <p>Virker spillet fortsatt slik det skal?</p> </li> <li> <p>Er spillet ferdig når papegøyen eller løvinnen kommer til kanten av skjermen?</p> </li> </ul> </section> <section class=save id=lagre-prosjektet-2> <h2 class=save id=lagre-prosjektet-2>Lagre prosjektet</h2> <p>Veldig bra! Nå er du ferdig og kan kose deg med spillet du har laget!</p> </section> </section> "}});